import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router } from 'react-router-dom';
import App from './App';
import forgotPassword from './ForgotPassword';

ReactDOM.render(
  <React.StrictMode>
    <Router>
      <forgotPassword />
    </Router>
  </React.StrictMode>,
  document.getElementById('root')
);
